CREATE DATABASE demo;

USE demo;
CREATE TABLE IF NOT EXISTS crimes (
    `Column_1` INT,
    `ID` INT,
    `Case_Number` VARCHAR(8) CHARACTER SET utf8,
    `Date` DATETIME,
    `Block` VARCHAR(35) CHARACTER SET utf8,
    `IUCR` VARCHAR(4) CHARACTER SET utf8,
    `Primary_Type` VARCHAR(22) CHARACTER SET utf8,
    `Description` VARCHAR(39) CHARACTER SET utf8,
    `Location_Description` VARCHAR(30) CHARACTER SET utf8,
    `Arrest` VARCHAR(5) CHARACTER SET utf8,
    `Domestic` VARCHAR(5) CHARACTER SET utf8,
    `Beat` INT,
    `District` INT,
    `Ward` INT,
    `Community_Area` INT,
    `FBI_Code` VARCHAR(3) CHARACTER SET utf8,
    `X_Coordinate` INT,
    `Y_Coordinate` INT,
    `Year` INT,
    `Updated_On` DATETIME,
    `Latitude` NUMERIC(11, 9),
    `Longitude` NUMERIC(11, 9),
    `Location` VARCHAR(29) CHARACTER SET utf8
);
